import React from 'react'

function Useronline({user}) {
  return (
    <li className='friendsimage'>
        <img className="sidebarimages"  src={user.profilePicture} alt=""/>
        <span className='ssidefriendname'>{user.username}</span>
    </li>
  )
}

export default Useronline
